import React from 'react';
import styled from 'styled-components';
const Container = styled.div`
    height: 30px;
    background-color: teal;
    color:white;
    align-items:center;
`

const Announcement = () => {
  return (
    <Container>
        Best place to buy Weed!!!!!
    </Container>
  )
};

export default Announcement;
